import Navbar from "../../components/navbar"
import Card from "../../components/card"

const Project = () => {
    
    return (
        <div>
            <Navbar />
                <h1 className="text-center font-medium text-3xl">My Project</h1>
            <div className="justify-center mt-10 mx-8 sm:mx-2 md:mx-5 flex-wrap sm:flex md:flex-wrap columns">
                {
                    <Card no={1} />}
            </div>
        </div>
    )
}

export default Project;
